// GQLLexerInit initializes any static state used to implement GQLLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewGQLLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func GQLLexerInit() {
	staticData := &GQLLexerLexerStaticData
	staticData.once.Do(gqllexerLexerInit)
}

// NewGQLLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewGQLLexer(input antlr.CharStream) *GQLLexer {
	GQLLexerInit()
	l := new(GQLLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &GQLLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "GQL.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

